CREATE TABLE IF NOT EXISTS "users_customuser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "profile_picture" varchar(100) NULL, "phone_number" varchar(20) NULL, "bio" text NOT NULL, "fullname" varchar(50) NOT NULL, "team_id" bigint NULL UNIQUE REFERENCES "teams_team" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "teams_team" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL UNIQUE, "captain_id" bigint NOT NULL REFERENCES "users_customuser" ("id") DEFERRABLE INITIALLY DEFERRED, "division_id" bigint NULL REFERENCES "teams_division" ("id") DEFERRABLE INITIALLY DEFERRED, "team_image" varchar(100) NULL, "bio" text NOT NULL, "location" varchar(255) NOT NULL);
