CREATE TABLE IF NOT EXISTS "scores_match" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "away_score" integer unsigned NOT NULL CHECK ("away_score" >= 0), "date" date NOT NULL, "away_team_id" bigint NOT NULL REFERENCES "teams_team" ("id") DEFERRABLE INITIALLY DEFERRED, "division_id" bigint NULL REFERENCES "teams_division" ("id") DEFERRABLE INITIALLY DEFERRED, "home_team_id" bigint NOT NULL REFERENCES "teams_team" ("id") DEFERRABLE INITIALLY DEFERRED, "home_score" integer unsigned NOT NULL CHECK ("home_score" >= 0));
